import * as React from 'react';
import AppBar from '@mui/material/AppBar';


export default class App extends React.Component{
  constructor(props){
    this.state = {
      imageLoaded: false,
      currentPage: 0
    };
  }

  render(){
    if (this.state.currentPage == 0){
      return(
        <AppBar></AppBar>
      );
    }else{
      return(
        <AppBar></AppBar>
      );
    }
  }
}
